export function About() {
  return (
    <section className="px-6 py-16 bg-gradient-to-br from-gray-900 via-black to-gray-900 text-white" id="about" data-aos="fade-up">
      <div className="max-w-4xl mx-auto text-center">
        <h2 className="text-4xl font-bold mb-6 border-b-4 inline-block border-indigo-500">About Me</h2>
        <p className="text-lg leading-relaxed text-gray-300 mt-4">
          I’m <strong className="text-indigo-400">Laeeba Javed</strong>, a Computer Science graduate from Aligarh Muslim University (CGPA 8.6/10), and an incoming Master's student at <span className="text-indigo-400">Universität des Saarlandes</span>.
          <br /><br />
          Passionate about AI and Full Stack Development, I’ve led technical communities, published in reputed journals, and built solutions that blend academic insight with real-world impact.
        </p>
      </div>
    </section>
  );
}
